USE [master]
GO

CREATE DATABASE [PriusPerformanceTests] ON  PRIMARY 
GO

USE [PriusPerformanceTests]
GO

CREATE TABLE [dbo].[Customers](
	[CustomerID] [bigint] IDENTITY(1,1) NOT NULL,
	[GivenNames] [nvarchar](200) NOT NULL,
	[FamilyName] [nvarchar](50) NOT NULL,
	[DateOfBirth] [date] NOT NULL,
	[Email] [varchar](200) NULL,
 CONSTRAINT [PK_Customers] PRIMARY KEY CLUSTERED ([CustomerID] ASC) ON [PRIMARY]

GO

CREATE TABLE [dbo].[Orders](
	[OrderID] [bigint] IDENTITY(1,1) NOT NULL,
	[CustomerID] [bigint] NOT NULL,
	[OrderDate] [datetime] NOT NULL,
	[ShippedDate] [datetime] NULL,
	[OrderTotal] [money] NOT NULL,
	[TaxAmount] [money] NOT NULL,
	[ShippingAmount] [money] NOT NULL,
 CONSTRAINT [PK_Orders] PRIMARY KEY CLUSTERED ([OrderID] ASC) ON [PRIMARY]

GO

ALTER TABLE [dbo].[Orders]  WITH CHECK ADD  CONSTRAINT [FK_CustomerOrders] FOREIGN KEY([CustomerID])
REFERENCES [dbo].[Customers] ([CustomerID])
GO

ALTER TABLE [dbo].[Orders] CHECK CONSTRAINT [FK_CustomerOrders]
GO

CREATE PROCEDURE [dbo].sp_GetCustomerOrders
	@CustomerID BIGINT
AS
BEGIN
	SELECT
		[OrderID],
		[CustomerID],
		[OrderDate],
		[ShippedDate],
		[OrderTotal],
		[TaxAmount],
		[ShippingAmount]
	FROM 
		[dbo].[Orders]
	WHERE
		[CustomerID]=@CustomerID
END

GO	

CREATE PROCEDURE [dbo].[sp_GetCustomer]
	@CustomerID BIGINT,
	@IncludeOrders BIT
AS
BEGIN
	SELECT
		[CustomerID],
		[GivenNames],
		[FamilyName],
		[DateOfBirth],
		[Email]
	FROM
		[dbo].[Customers]
	WHERE
		[CustomerID]=@CustomerID

	IF @IncludeOrders != 0
	BEGIN
		EXEC [dbo].[sp_GetCustomerOrders] @CustomerID
	END
END
GO

CREATE PROCEDURE dbo.sp_GetAllCustomers
AS
BEGIN
	SELECT
		[CustomerID],
		[GivenNames],
		[FamilyName],
		[DateOfBirth],
		[Email]
	FROM
		dbo.[Customers]
END
GO

CREATE PROCEDURE dbo.sp_GetAllOrders
AS
BEGIN
	SELECT
		[OrderID],
		[CustomerID],
		[OrderDate],
		[ShippedDate],
		[OrderTotal],
		[TaxAmount],
		[ShippingAmount]
	FROM 
		dbo.[Orders]
END
